/* color palette from <https://github.com/vuejs/theme> */
*,
*::before,
*::after {
  box-sizing: border-box;
  margin: 0;
  padding: 0;
  font-weight: normal;
}

ul {
    list-style: none;
}

a {
    text-decoration: none;
}

@import './css/base.css';

@font-face {
